//import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Axios from 'axios';
import ResourceManager from './ResourceManager'
import Worker from './Worker'
import Configure from './Configure'
import { bigIntLiteral } from '@babel/types';
import CalculateCommission from './CalculateCommission';
//import Dropdown from 'react-bootstrap/Dropdown';
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';
//import DropdownButton from 'react-bootstrap/DropdownButton';
//resource manager, resource, resource customer rate, resource salary, resource hour. commission rate
class Tiles extends Component {
  constructor(props, context) {
    super(props);
    this.state = {
      data : [],
    }
    this.handleResourceManager = this.handleResourceManager.bind(this);
  }

  handleResourceManager(event) {
    event.preventDefault();
    // debugger
      Axios({
        url: 'http://localhost:8080/', 
        method: "get",
        headers: {
          'Content-Type': 'application/json'
        }

      }).then(res => {
        // debugger
        console.log(res.data);
        this.setState({
          showRM : true,
          data : res.data
        })
      }).catch(err => {
        console.log(err);
      })
    }


      handleOnChange = (event) => {
          console.log("line 88", event.target.value);
          let obj = {}

          obj[event.target.id] = event.target.value;

          this.setState({

            ...this.state.startDate,

            ...this.state.endDate,

            ...obj


          })
        }

        handleSelect = (event) => {
          debugger
          this.setState({
            resourceManagerId: this.state.nameMap[event.value]
          })
        }

  render () {
    console.log(this.state);

    return (
      <div className = "row">
      <Container>
      <Card.Body>
      <Col>
        <Button variant="primary" onClick= {this.handle}>Update Calendar</Button>
        </Col>
      </Card.Body>
      </Container>
      <Modal show={this.state.showRM} onHide={this.handleClose}>
          <Modal.Header>
            <Modal.Title>Add Worker</Modal.Title>
          </Modal.Header>
          <form onSubmit={this.handleSubmitAdd}>
            <Modal.Body>
              <label For="name">Name</label>
              <input id="name" name="name" type="text" onChange={this.handleOnChange} value={this.state.name} />
            </Modal.Body>
            <Modal.Footer>
              <Button variant="secondary" onClick={this.handleClose}>
                Close
                </Button>
              <Button type="submit" variant="primary" >
                Submit
                </Button>
            </Modal.Footer>
          </form>
        </Modal>
    </div>

    )
  }

}

export default Tiles;
